(249, 'educate_theme_options', 'a:59:{s:4:"logo";s:96:"http://ebenezerssschool.org/wp-content/uploads/2016/01/12584166_916424965106904_1869758518_n.jpg";s:7:"favicon";s:0:"";s:9:"blogtitle";s:0:"";s:11:"footer-logo";s:0:"";s:10:"footertext";s:0:"";s:12:"slider-img-1";s:75:"http://www.ebenezerssschool.org/wp-content/uploads/2016/12/Web-Banner_2.jpg";s:14:"slider-title-1";s:0:"";s:15:"slidercontent-1";s:0:"";s:12:"slider-img-2";s:75:"http://www.ebenezerssschool.org/wp-content/uploads/2016/12/Web-Banner_1.jpg";s:14:"slider-title-2";s:0:"";s:15:"slidercontent-2";s:0:"";s:12:"slider-img-3";s:75:"http://www.ebenezerssschool.org/wp-content/uploads/2016/12/Web-Banner_3.jpg";s:14:"slider-title-3";s:0:"";s:15:"slidercontent-3";s:0:"";s:12:"slider-img-4";s:75:"http://www.ebenezerssschool.org/wp-content/uploads/2016/12/Web-Banner_4.jpg";s:14:"slider-title-4";s:0:"";s:15:"slidercontent-4";s:0:"";s:12:"slider-img-5";s:75:"http://www.ebenezerssschool.org/wp-content/uploads/2016/12/Web-Banner_5.jpg";s:14:"slider-title-5";s:0:"";s:15:"slidercontent-5";s:0:"";s:12:"slider-img-6";s:75:"http://www.ebenezerssschool.org/wp-content/uploads/2016/12/Web-Banner_6.jpg";s:14:"slider-title-6";s:0:"";s:15:"slidercontent-6";s:0:"";s:12:"slider-img-7";s:75:"http://www.ebenezerssschool.org/wp-content/uploads/2016/12/Web-Banner_7.jpg";s:14:"slider-title-7";s:0:"";s:15:"slidercontent-7";s:0:"";s:12:"slider-img-8";s:75:"http://www.ebenezerssschool.org/wp-content/uploads/2016/12/Web-Banner_8.jpg";s:14:"slider-title-8";s:0:"";s:15:"slidercontent-8";s:0:"";s:11:"about-title";s:5:"About";s:15:"about-sub-title";s:32:"Ebenezer Senior Secondary School";s:12:"about-detail";s:786:"The school founded in 1988 and is modern and attractive in both layout and construction. In the beginning the school was run by the Evangelical group then the Ebenezer Society took over the management of the Educational Institution of the immaculate conceptions in 2002-03. The school is affiliated to CBSE,Delhi. Our educational system is based on most modern scientific and psychological methods. The aim of the school is the all round formation of the students to make them good human beings and worthy citizens of the country that is rich in diverse cultures, religions, languages and customs. We aim to provide an environment where excellence is encouraged , where students are challenged in their learning and develop capabilities that will support them and prepare them for life.";s:12:"about-icon-1";s:1:"a";s:12:"abouttitle-1";s:15:"Medical Checkup";s:11:"aboutdesc-1";s:122:"We not only educate, we are also concerned about the health of your children. That''s why we have medical checkup facility.";s:12:"about-icon-2";s:1:"b";s:12:"abouttitle-2";s:12:"Bus Facility";s:11:"aboutdesc-2";s:122:"We provided state-of-the-art pickup facility for your children, so you don''t have to struggle for your children''s commute.";s:12:"about-icon-3";s:1:"c";s:12:"abouttitle-3";s:11:"Play School";s:11:"aboutdesc-3";s:95:"We have a play school with helping teachers, friendlier ambiance which help your children grow.";s:12:"about-icon-4";s:0:"";s:12:"abouttitle-4";s:0:"";s:11:"aboutdesc-4";s:0:"";s:12:"about-icon-5";s:0:"";s:12:"abouttitle-5";s:0:"";s:11:"aboutdesc-5";s:0:"";s:10:"blog-title";s:0:"";s:14:"blog-sub-title";s:0:"";s:13:"blog-category";s:0:"";s:13:"mission-title";s:17:"Directors Message";s:17:"mission-sub-title";s:15:"Mr. Ashok Joshi";s:14:"mission-detail";s:917:"The goal before us is to create an atmosphere which will turn the thoughts and aspirations of our children towards the libration of spirit. Our school is firstly responsible for maintaining a caring environment and continuously work on an exemplary and successful teaching-learning, extra curricular and co-curricular practices with a decision making personality, which provides an extra-ordinary identity for each child. Our staff continues to move forward through thoughtful planning,maintenance of effective curriculam creation of new programs and powerful partnerships with both parents and society members .Our effective Parents-Teachers meeting continued to work dilingently to create a supportive and caring school community. Lets continue our patnership in helping each other to make Ebenezer a wonderful place for our children . Let us create an atmosphere where students feel safe comfortable and respected.";s:17:"mission-link-name";s:0:"";s:12:"mission-link";s:0:"";s:5:"fburl";s:21:"https://goo.gl/To1PnX";s:7:"twitter";s:0:"";s:7:"youtube";s:0:"";s:3:"rss";s:0:"";}', 'yes'),
