mages.com/images/premade/et-logo.png" show_in_lightbox="off" url_new_window="off" animation="bottom" /][/et_pb_column][et_pb_column type="1_4"][et_pb_image admin_label="Image" src="http://elegantthemesimages.com/images/premade/et-logo.png" show_in_lightbox="off" url_new_window="off" animation="bottom" /][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fullwidth="off" specialty="off"][et_pb_row][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="light" text_orientation="center"]<h1>Frequently Asked Questions</h1>[/et_pb_text][et_pb_toggle admin_label="Toggle" title="Can I use the themes on multiple sites?" open="off"]Yes, you are free to use our themes on as many websites as you like. We do not place any restrictions on how many times you can download or use a theme, nor do we limit the number of domains that you can install our themes to.[/et_pb_toggle][et_pb_toggle admin_label="Toggle" title="What is your refund policy?" open="on"]We offer no-questions-asked refunds to all customers within 30 days of your purchase. If you are not satisfied with our product, then simply send us an email and we will refund your purchase right away. Our goal has always been to create a happy, thriving community. If you are not thrilled with the product or are not enjoying the experience, then we have no interest in forcing you to stay an unhappy member.[/et_pb_toggle][et_pb_toggle admin_label="Toggle" title="What are Photoshop Files?" open="off"]Elegant Themes offers two different packages: Personal and Developer. The Personal Subscription is ideal for the average user while the Developers License is meant for experienced designers who wish to customize their themes using the original Photoshop files. Photoshop files are the original design files that were used to create the theme. They can be opened using Adobe Photoshop and edited, and prove very useful for customers wishing to change their theme''s design in some way.[/et_pb_toggle][et_pb_toggle admin_label="Toggle" title="Can I upgrade after signing up?" open="off"]Yes, you can upgrade at any time after signing up. When you log in as a "personal" subscriber, you will see a notice regarding your current package and instructions on how to upgrade.[/et_pb_toggle][et_pb_toggle admin_label="Toggle" title="Can I use your themes with WP.com?" open="off"]Unfortunately WordPress.com does not allow the use of custom themes. If you would like to use a custom theme of any kind, you will need to purchase your own hosting account and install the free software from WordPress.org. If you are looking for great WordPress hosting, we recommend giving HostGator a try.[/et_pb_toggle][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fullwidth="off" specialty="off" background_image="http://elegantthemesimages.com/images/premade/d2-placeholder-1920.jpg" background_color="#ffffff" inner_shadow="on" parallax="off"][et_pb_row][et_pb_column type="4_4"][et_pb_cta admin_label="Call To Action" title="Don''t Be Shy" button_url="#" button_text="Get In Touch" use_background_color="off" background_color="#108bf5" background_layout="dark" text_orientation="center"]If we didn''t answer all of your questions, feel free to drop us a line anytime.[/et_pb_cta][/et_pb_column][/et_pb_row][/et_pb_section]', 'Sales Page', '', 'publish', 'closed', 'closed', '', 'sales-page', '', '', '2016-01-05 19:36:52', '2016-01-05 19:36:52', '', 0, 'http://ebenezerssschool.org/et_pb_layout/sales-page/', 0, 'et_pb_layout', '', 0),
