cement="top" font_icon=""]Divis layout has been designed with mobile devices in mind. No matter how you use it, and no matter how you view it, your website is going to look great.[/et_pb_blurb][/et_pb_column][et_pb_column type="1_4"][et_pb_blurb admin_label="Blurb" title="Strategy" url_new_window="off" image="http://elegantthemes.com/preview/Divi2/wp-content/uploads/2014/04/blurb-icon-updates.png" animation="top" background_layout="dark" text_orientation="center" use_icon="on" icon_color="#d85fd6" use_circle="on" circle_color="#0d2035" use_circle_border="off" circle_border_color="#2caaca" icon_placement="top" font_icon=""]Divi is here to stay, and you can rest easy knowing that our team will be updating and improving it for years to come. Build on top of a powerful foundation.[/et_pb_blurb][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fullwidth="off" background_color="#ffffff" inner_shadow="off" parallax="off" module_id="builder"][et_pb_row][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="light" text_orientation="center"]<h1>Advanced Drag & Drop Builder</h1>\r\nThe Divi Builder was made with user experience at the forefront of its priorities. The way it is broken up into sections, rows, columns and widgets, really allows you to understand and edit the structure of your page. Your editing controls are pulled out of the main content area so that you get a clear and concise representation of how your modules fit into your page layout.[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row][et_pb_column type="4_4"][et_pb_image admin_label="Image" src="http://elegantthemesimages.com/images/premade/d2-placeholder-1080px.jpg" url_new_window="off" animation="right" show_in_lightbox="off" /][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fullwidth="on" specialty="off" background_color="#ffffff" inner_shadow="off" parallax="on" module_id="backgrounds"][et_pb_fullwidth_slider admin_label="Fullwidth Slider" show_arrows="on" show_pagina