" background_layout="light" text_orientation="left"]Divi Ships with a tone of great premade layouts to get you started with a homepage, a portfolio, an eCommerce Storefront, and much more! Check out the theme demo to preview a few of these premade layouts. We''ve even realeased layout packs along the way for portfolios and business focused websites.[/et_pb_cta][/et_pb_column][/et_pb_row][et_pb_row][et_pb_column type="1_2"][et_pb_divider admin_label="Divider" color="#ffffff" show_divider="off" height="40" /][et_pb_cta admin_label="Call To Action" title="Product Feature" button_url="#" button_text="Learn More" use_background_color="off" background_color="#2caaca" background_layout="light" text_orientation="right"]Divi Ships with a tone of great premade layouts to get you started with a homepage, a portfolio, an eCommerce Storefront, and much more! Check out the theme demo to preview a few of these premade layouts. We''ve even realeased layout packs along the way for portfolios and business focused websites.[/et_pb_cta][/et_pb_column][et_pb_column type="1_2"][et_pb_image admin_label="Image" src="http://elegantthemesimages.com/images/premade/d2-placeholder-510px.jpg" url_new_window="off" animation="left" show_in_lightbox="off" /][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fullwidth="off" specialty="off" background_color="#f74b47" inner_shadow="off" parallax="off"][et_pb_row][et_pb_column type="4_4"][et_pb_cta admin_label="Call To Action" title="Signup Today For Instant Access" button_url="#" button_text="Join Today" use_background_color="off" background_color="#2ea3f2" background_layout="dark" text_orientation="center"]Join today and get access to Divi, as well as our other countless themes and plugins.[/et_pb_cta][/et_pb_column][/et_pb_row][/et_pb_section]', 'Product Features', '', 'publish', 'closed', 'closed', '', 'product-features', '', '', '2016-01-05 19:36:52', '2016-01-05 19:36:52', '', 0, 'http://ebenezerssschool.org/et_pb_layout/product-features/'