(37, 1, '2016-01-06 18:14:22', '2016-01-06 18:14:22', '<img class="size-full wp-image-195 aligncenter" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/designer-approach-aim.png" alt="designer-approach-aim" width="940" height="296" />\r\n\r\n&nbsp;\r\n<table border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<ul>\r\n	<li style="text-align: left;">To provide quality academic competence worthwhile to compete best in the career making field.</li>\r\n	<li style="text-align: left;">Balanced physical,moral and emotional development of students that he/she proves his usefulness in the society.</li>\r\n	<li style="text-align: left;">Students'' all round development through games,cultural, literary and other extra co-curricular activities.</li>\r\n	<li style="text-align: left;">To instill scientific, positive and rational attitude towards life and its problems.</li>\r\n	<li style="text-align: left;">Continuous improvement in teaching process and infra-structure to develop aforesaid qualities in students.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td><b><span style="color: #ff0000;">Success is our Tradition </span></b></td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Aim', '', 'publish', 'closed', 'closed', '', 'aim', '', '', '2016-01-10 05:55:48', '2016-01-10 05:55:48', '', 41, 'http://ebenezerssschool.org/?page_id=37', 0, 'page', '', 0),
