(41, 1, '2016-01-07 04:18:57', '2016-01-07 04:18:57', '<img class="size-full wp-image-186 aligncenter" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/about-us_pages_banner-compressed.jpg" alt="about-us_pages_banner-compressed" width="965" height="329" />\r\n<p style="text-align: justify;">Ebenezer Higher Secondary School located in Upadhyay Nagar, Mendhaki Road, is a Co-Educational Senior Secondary institution affiliated to the Central Board of Secondary Education (CBSE) on Provisional basis since 1988. The school has been operating officially under the trust/society Ebenezer Society. The school is equipped with 28 class rooms and all essential facilities. If you''re looking for details in admission/application forms, fees, school timings, vacations/holidays schedule or facilities provided, kindly visit the relevant department of the school.</p>', 'About', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2016-12-30 23:27:09', '2016-12-30 17:57:09', '', 0, 'http://ebenezerssschool.org/?page_id=41', 0, 'page', '', 0),
(42, 1, '2016-01-07 04:18:57', '2016-01-07 04:18:57', '<p style="text-align: justify;"><strong>The ford foundation members of Ebenezer Higher SecondarySchool started this academic institution on Feb.1990, which is a co-educational English Medium School by keeping following views in mind.</strong></p>\r\n<p style="text-align: justify;">A modern and technology teaching approach at one end a value based educational system at the other "The desire inter active, effective teaching method adopted by the institution has been chosen as the contestant to be declared as the magnet school among all other school of the city.</p>', 'About Us', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2016-01-07 04:18:57', '2016-01-07 04:18:57', '', 41, 'http://ebenezerssschool.org/2016/01/07/41-revision-v1/', 0, 'revision', '', 0),
(43, 1, '2016-01-07 04:20:58', '2016-01-07 04:20:58', '<p style="text-align: justify;"></p>\r\n<p style="text-align: justify;"></p>\r\n<img class="size-full wp-image-192" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/Dollarphotoclub_64886873-Custom-960x250.jpg" alt="Team forming Mission word" width="960" height="250" />\r\n<p style="text-align: justify;">The sole objective of education is not just only to imparting bookish knowledge but also to imbibe some moral and social values to help the students to enter into a gracious relationship with the world to experience it as meaningful &amp; worthwhile need of the hour. By keeping this purpose in our mind, we are making endeavor to accomplish this objective through imparting instruction to the student with optimum sue of latest technology.</p>', 'Our Mission', '', 'publish', 'closed', 'closed', '', 'our-mission', '', '', '2016-01-10 05:52:29', '2016-01-10 05:52:29', '', 41, 'http://ebenezerssschool.org/?page_id=43', 0, 'page', '', 0),
(44, 1, '2016-01-07 04:20:58', '2016-01-07 04:20:58', '<p style="text-align: justify;">The sole objective of education is not just only to imparting bookish knowledge but also to imbibe some moral and social values to help the students to enter into a gracious relationship with the world to experience it as meaningful &amp; worthwhile need of the hour. By keeping this purpose in our mind, we are making endeavor to accomplish this objective through imparting instruction to the student with optimum sue of latest technology.</p>', 'Our Mission', '', 'inherit', 'closed', 'closed', '', '43-revision-v1', '', '', '2016-01-07 04:20:58', '2016-01-07 04:20:58', '', 43, 'http://ebenezerssschool.org/2016/01/07/43-revision-v1/', 0, 'revision', '', 0),
(45, 1, '2016-01-07 04:21:45', '2016-01-07 04:21:45', '<p style="text-align: justify;">The school provides an ample infrastructure having physical facilities including- Well planned, fully furnished, airy &amp; spacious class rooms. Well equipped laboratories for Science &amp; Mathematics. A well stacked library having books of great author, fiction, story books etc. A basic need of today, computer education is compulsory for all classes. School provides extra curricular &amp; co-circular activities such as music, dance, art and craft. For XI &amp; XII classes, science &amp; commerce faculties are available.</p>', 'Our Experiences', '', 'publish', 'closed', 'closed', '', 'our-experiences', '', '', '2016-01-07 04:21:45', '2016-01-07 04:21:45', '', 0, 'http://ebenezerssschool.org/?page_id=45', 0, 'page', '', 0),
