(47, 1, '2016-01-07 04:23:38', '2016-01-07 04:23:38', '<p style="text-align: justify;"><img class="alignnone  wp-image-243" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/DSC05078-compressed-1024x768.jpg" alt="DSC05078-compressed" width="423" height="317" /></p>\r\n<p style="text-align: justify;">A school Is always a world in miniature , where one receives a training of life , where effective , meaningful and joyful learning take place , it is here that we begin to learn our lesson of life  to accept challenges, face competitions, defeat and failure, and rejoice at victory and triumph. Our school is scaling new height with excellent and reputed national and international level coaches who are children in a range of co-curricular activities like throw-ball, baseball, soft-tennis etc. For the future, we are hopeful that we will be able to fulfill all the expectation of our student and their parents for best education as well as the personality development so that they can go in outer world with the strength to excel in their professional life by being a beautiful human and responsible citizen of our country.</p>', 'From the Principal ''s Desk', '', 'publish', 'closed', 'closed', '', 'from-the-principal-s-desk', '', '', '2016-01-24 13:48:15', '2016-01-24 13:48:15', '', 41, 'http://ebenezerssschool.org/?page_id=47', 0, 'page', '', 0),
