(93, 1, '2016-01-09 12:57:16', '2016-01-09 12:57:16', '<p style="text-align: justify;">Composite Science Lab, Physics, Chemistry and Biology Lab, Maths Lab, Computer Science Lab, Home Science Lab, Library, Indoor Games, Dance Rooms, Music Rooms, Health and Medical Check up</p>\r\n<p style="text-align: justify;">Ebenezer Higher Secondary School has Library facility constituting , Periodicals, Dailies, Reference Books, Magazine, and with about <span class="b">3900 books.</span></p>', 'Facilities', '', 'publish', 'closed', 'closed', '', 'facilities', '', '', '2016-03-13 21:41:58', '2016-03-13 16:11:58', '', 0, 'http://ebenezerssschool.org/?page_id=93', 0, 'page', '', 0),
(94, 1, '2016-01-09 12:57:16', '2016-01-09 12:57:16', '', 'Facilities', '', 'inherit', 'closed', 'closed', '', '93-revision-v1', '', '', '2016-01-09 12:57:16', '2016-01-09 12:57:16', '', 93, 'http://ebenezerssschool.org/2016/01/09/93-revision-v1/', 0, 'revision', '', 0),
(98, 1, '2016-01-09 12:58:26', '2016-01-09 12:58:26', '<div style="width:100%; text-align:center" ><img class="wp-image-198 aligncenter" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/33-1024x683.jpg" alt="33" width="560" height="373" /></div>\r\n<p style="text-align: justify;">Our Science lab is fully equipped with the latest apparatus to bring forth the scientist in every child .The basic purpose of the lab is to prepare children for life by instilling in them an approach to analyse problems and find solutions on their own.\r\nHistory comes alive in our Social Science lab and make the students aware of their wonderful natural heritage and their responsibility helps our children imbibe majestic traditions with modern thoughts and attitudes.\r\nThey learn the skills to solve mathematics by fun and by using tools.</p>', 'Labs', '', 'publish', 'closed', 'closed', '', 'labs', '', '', '2016-01-31 16:01:34', '2016-01-31 16:01:34', '', 93, 'http://ebenezerssschool.org/?page_id=98', 0, 'page', '', 0),
