(100, 1, '2016-01-09 12:58:48', '2016-01-09 12:58:48', '<div style="width:100%; text-align:center" ><img class="wp-image-204 aligncenter" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/DSC_5487-1024x683.jpg" alt="DSC_5487" width="378" height="252" /></div>\r\n<p style="text-align: justify;">The Library makes available a wide selection of reading material . It promotes reading habits among students works as an agency for their life long continuous self education . It motivates and encourages the habit of reading which will help knowledge . A wide range of fictional and factual works transport the minds of our students to a land of fantacy and make believe, when in mind of recreation. We have a well equipped open-self library.</p>', 'Library', '', 'publish', 'closed', 'closed', '', 'library', '', '', '2016-01-31 16:02:48', '2016-01-31 16:02:48', '', 93, 'http://ebenezerssschool.org/?page_id=100', 0, 'page', '', 0),
