(104, 1, '2016-01-09 13:00:25', '2016-01-09 13:00:25', '<strong>We have our pupils medically examined by expert child specialist twice a year in addtion to the regular  checkups conducted by the resident doctor . Health record books will be maintained by the school</strong>', 'Medical Checkups', '', 'publish', 'closed', 'closed', '', 'medical-checkups', '', '', '2017-01-04 17:25:48', '2017-01-04 11:55:48', '', 93, 'http://ebenezerssschool.org/?page_id=104', 0, 'page', '', 0),
