(106, 1, '2016-01-09 13:00:50', '2016-01-09 13:00:50', '<p style="text-align: justify;"><img class="size-full wp-image-426 aligncenter" src="http://www.ebenezerssschool.org/wp-content/uploads/2016/01/computer-labs-banner.png" alt="computer-labs-banner" width="710" height="300" /></p>\r\n<p style="text-align: justify;"></p>\r\n<p style="text-align: justify;"><strong>School has two separate computer labs for Junior and Senior wings. In both labs students are taught computer from class Ist onwards. The machines are constantly updated at any point in time with specialzation in all the latest software and languages. Educational CDs provide additional support to our endeavour.</strong></p>', 'Computer Lab', '', 'publish', 'closed', 'closed', '', 'computer-lab', '', '', '2017-01-04 17:16:36', '2017-01-04 11:46:36', '', 93, 'http://ebenezerssschool.org/?page_id=106', 0, 'page', '', 0),
