(121, 1, '2016-01-09 13:25:09', '2016-01-09 13:25:09', '<p style="text-align: justify;">Ebenezer Higher Secondary School located in Upadhyay Nagar, Mendhaki Road, is a Co-Educational Senior Secondary institution affiliated to the Central Board of Secondary Education (CBSE) on Provisional basis since 1988. The school has been operating officially under the trust/society Ebenezer Society. The school is equipped with 28 class rooms and all essential facilities. If you''re looking for details in admission/application forms, fees, school timings, vacations/holidays schedule or facilities provided, kindly visit the relevant department of the school.</p>', 'About Us', '', 'inherit', 'closed', 'closed', '', '41-autosave-v1', '', '', '2016-01-09 13:25:09', '2016-01-09 13:25:09', '', 41, 'http://ebenezerssschool.org/2016/01/09/41-autosave-v1/', 0, 'revision', '', 0),
(122, 1, '2016-01-10 05:54:40', '2016-01-10 05:54:40', '<img class="alignnone size-full wp-image-195" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/designer-approach-aim.png" alt="designer-approach-aim" width="940" height="296" />\n\n&nbsp;\n<table border="0" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td>\n<ul>\n	<li style="text-align: left;">To provide quality academic competence worthwhile to compete best in the career making field.</li>\n	<li style="text-align: left;">Balanced physical,moral and emotional development of students that he/she proves his usefulness in the society.</li>\n	<li style="text-align: left;">Students'' all round development through games,cultural, literary and other extra co-curricular activities.</li>\n	<li style="text-align: left;">To instill scientific, positive and rational attitude towards life and its problems.</li>\n	<li style="text-align: left;">Continuous improvement in teaching process and infra-structure to develop aforesaid qualities in students.</li>\n</ul>\n</td>\n</tr>\n<tr>\n<td><b><span style="color: #ff0000;">Success is our Tradition </span></b></td>\n</tr>\n</tbody>\n</table>', 'Aim', '', 'inherit', 'closed', 'closed', '', '37-autosave-v1', '', '', '2016-01-10 05:54:40', '2016-01-10 05:54:40', '', 37, 'http://ebenezerssschool.org/2016/01/09/37-autosave-v1/', 0, 'revision', '', 0),
