(131, 1, '2016-01-09 13:55:49', '2016-01-09 13:55:49', '<div align="center"><center></center></div>\r\n<dl><dd><b><span style="color: #cc0099; font-family: cursive; font-size: large;">S</span></b><span style="color: #000080; font-family: cursive; font-size: large;">chool has two separate computer labs for Junior and Senior wings. In both labs students are taught computer from class I<sup>st</sup> onwards. The machines are constantly updated at any point in time with specialzation in all the latest software and languages. Educational CDs provide additional support to our endeavour.</span></dd></dl>', 'Computer Lab', '', 'inherit', 'closed', 'closed', '', '106-autosave-v1', '', '', '2016-01-09 13:55:49', '2016-01-09 13:55:49', '', 106, 'http://ebenezerssschool.org/2016/01/09/106-autosave-v1/', 0, 'revision', '', 0),
(132, 1, '2016-01-09 13:56:15', '2016-01-09 13:56:15', '<p style="text-align: justify;">School has two separate computer labs for Junior and Senior wings. In both labs students are taught computer from class Ist onwards. The machines are constantly updated at any point in time with specialzation in all the latest software and languages. Educational CDs provide additional support to our endeavour.</p>', 'Computer Lab', '', 'inherit', 'closed', 'closed', '', '106-revision-v1', '', '', '2016-01-09 13:56:15', '2016-01-09 13:56:15', '', 106, 'http://ebenezerssschool.org/2016/01/09/106-revision-v1/', 0, 'revision', '', 0),
(133, 1, '2016-01-09 13:57:27', '2016-01-09 13:57:27', '<p style="text-align: justify;">Our Science lab is fully equipped with the latest apparatus to bring forth the scientist in every child .The basic purpose of the lab is to prepare children for life by instilling in them an approch to analyse problems and find solutions on their own.\r\nHistory comes alive in our Social Science lab and make the students aware of their wonderful natural heritage and their responsibilty helps our children imbibe majestic traditions with modern thoughts and attitudes.\r\nThey learn the skills to solve mathematics by fun and by using tools.</p>', 'Labs', '', 'inherit', 'closed', 'closed', '', '98-revision-v1', '', '', '2016-01-09 13:57:27', '2016-01-09 13:57:27', '', 98, 'http://ebenezerssschool.org/2016/01/09/98-revision-v1/', 0, 'revision', '', 0),
(134, 1, '2016-01-09 13:58:42', '2016-01-09 13:58:42', '<p style="text-align: justify;">The school own transport of its own playing between different areas and the school compley to transport the students from home to school and back.</p>', 'Transport', '', 'inherit', 'closed', 'closed', '', '102-revision-v1', '', '', '2016-01-09 13:58:42', '2016-01-09 13:58:42', '', 102, 'http://ebenezerssschool.org/2016/01/09/102-revision-v1/', 0, 'revision', '', 0),
(135, 1, '2016-01-09 13:59:44', '2016-01-09 13:59:44', '<p style="text-align: justify;">The Library makes available a wide selection of reading material . It promotes reading habits amoung students works as an agency for their life long continuous self education . It motivates and encourages the habit of reading which will help knowledge . A wide range of fictional and factual works transport the minds of our students to a land of fantacy and make believe, when in mind of recreation. We have a well equipped open-self library.</p>', 'Library', '', 'inherit', 'closed', 'closed', '', '100-revision-v1', '', '', '2016-01-09 13:59:44', '2016-01-09 13:59:44', '', 100, 'http://ebenezerssschool.org/2016/01/09/100-revision-v1/', 0, 'revision', '', 0),
(136, 1, '2016-01-09 14:00:52', '2016-01-09 14:00:52', 'We have our pupils medically examined by expert child specialist twice a year in addtion to the regular  checkups conducted by the resident doctor . Health record books will be maintained by the school', 'Medical Checkups', '', 'inherit', 'closed', 'closed', '', '104-revision-v1', '', '', '2016-01-09 14:00:52', '2016-01-09 14:00:52', '', 104, 'http://ebenezerssschool.org/2016/01/09/104-revision-v1/', 0, 'revision', '', 0),
(137, 1, '2016-01-27 10:08:20', '2016-01-27 10:08:20', '<strong>ADMISSION</strong>\n<ul>\n	<li>Open to all boys and girls irrespective of caste,creed or race.</li>\n	<li>pupils must complete three years of age for Nursery,four years of age on 1st July for being eligible for adimission to KG I. Corresponding scales of age will be fixed for the succeeding classes.</li>\n	<li>The following documents are required at the time of admission.</li>\n	<li>BirthCertificate for Nursery,KG and UKG.</li>\n	<li>TC Duly Counter Signed</li>\n	<li>Photocopy of the Report Card</li>\n	<li>First Fee instalment</li>\n	<li>Copy of Caste Certificate for SC/ST/OBC</li>\n	<li>Migration Certificate (if previous exam passed from different Board)</li>\n</ul>\n<strong>EXAMINATIONS</strong>\n<ul>\n	<li>As per CBSE norms,Formative and Summative Assessments shall be conducted .</li>\n	<li>In case of medical leave during examination , a medical certificate should be furnished.</li>\n	<li>Students absent from test/examination without adequate reasons or prior permission will be considered as having failed. Students absent from examination will not be re-examined.</li>\n	<li>Students using unfair means at examination will be dealt with severely and may be expelled from the school.</li>\n</ul>', 'Guidelines', '', 'inherit', 'closed', 'closed', '', '108-autosave-v1', '', '', '2016-01-27 10:08:20', '2016-01-27 10:08:20', '', 108, 'http://ebenezerssschool.org/2016/01/09/108-autosave-v1/', 0, 'revision', '', 0),
(138, 1, '2016-01-09 14:03:51', '2016-01-09 14:03:51', '<strong>ADMISSION</strong>\r\n<ul>\r\n	<li>Open to all boys and girls irrespective of caste,creed or race.</li>\r\n	<li>pupils must complete three years of age for Nursery,four years of age on 1st July for being eligible for adimission to KG I. Corresponding scales of age will be fixed for the succeeding classes.</li>\r\n	<li>The following documents are required at the time of admission.</li>\r\n	<li>BirthCertificate for Nursery,KG and Std.</li>\r\n	<li>TC Duly Counter Signed</li>\r\n	<li>Photocopy of the Report Card</li>\r\n	<li>First Fee instalment</li>\r\n	<li>Copy of Caste Certificate for SC/ST/OBC</li>\r\n	<li>Migration Certificate (if previous exam passed from different Board)</li>\r\n</ul>\r\n<strong>EXAMINATIONS</strong>\r\n<ul>\r\n	<li>As per CBSE norms,Formative and Summative Assessments shall be conducted .</li>\r\n	<li>In case of medical leave during examination , a medical certificate should be furnished.</li>\r\n	<li>Students absent from test/examination without adequate reasons or prior permission will be considered as having failed. Students absent from examination will not be re-examined.</li>\r\n	<li>Students using unfair means at examination will be dealt with severely and may be expelled from the school.</li>\r\n</ul>', 'Guidelines', '', 'inherit', 'closed', 'closed', '', '108-revision-v1', '', '', '2016-01-09 14:03:51', '2016-01-09 14:03:51', '', 108, 'http://ebenezerssschool.org/2016/01/09/108-revision-v1/', 0, 'revision', '', 0),
