(193, 1, '2016-01-10 05:52:00', '2016-01-10 05:52:00', '<p style="text-align: justify;"></p>\n<p style="text-align: justify;"></p>\n<p style="text-align: justify;">The sole objective of education is not just only to imparting bookish knowledge but also to imbibe some moral and social values to help the students to enter into a gracious relationship with the world to experience it as meaningful &amp; worthwhile need of the hour. By keeping this purpose in our mind, we are making endeavor to accomplish this objective through imparting instruction to the student with optimum sue of latest technology.</p>', 'Our Mission', '', 'inherit', 'closed', 'closed', '', '43-autosave-v1', '', '', '2016-01-10 05:52:00', '2016-01-10 05:52:00', '', 43, 'http://ebenezerssschool.org/2016/01/10/43-autosave-v1/', 0, 'revision', '', 0),
(194, 1, '2016-01-10 05:52:29', '2016-01-10 05:52:29', '<p style="text-align: justify;"></p>\r\n<p style="text-align: justify;"></p>\r\n<img class="size-full wp-image-192" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/Dollarphotoclub_64886873-Custom-960x250.jpg" alt="Team forming Mission word" width="960" height="250" />\r\n<p style="text-align: justify;">The sole objective of education is not just only to imparting bookish knowledge but also to imbibe some moral and social values to help the students to enter into a gracious relationship with the world to experience it as meaningful &amp; worthwhile need of the hour. By keeping this purpose in our mind, we are making endeavor to accomplish this objective through imparting instruction to the student with optimum sue of latest technology.</p>', 'Our Mission', '', 'inherit', 'closed', 'closed', '', '43-revision-v1', '', '', '2016-01-10 05:52:29', '2016-01-10 05:52:29', '', 43, 'http://ebenezerssschool.org/2016/01/10/43-revision-v1/', 0, 'revision', '', 0),
