(215, 1, '2016-01-11 07:23:47', '2016-01-11 07:23:47', '<p style="text-align: justify;">The goal before us is to create an atmosphere which will turn the thoughts and aspirations of our children towards the liberation of spirit. Our school is firstly responsible for maintaining a caring environment and continuously work on an exemplary and successful teaching-learning, extra curricular and co-curricular practices with a decision making personality, which provides an extra-ordinary identity for each child. Our staff continues to move forward through thoughtful planning,maintenance of effective curriculum creation of new programs and powerful partnerships with both parents and society members .Our effective Parents-Teachers meeting continued to work diligently to create a supportive and caring school community. Lets continue our partnership in helping each other to make Ebenezer a wonderful place for our children . Let us create an atmosphere where students feel safe comfortable and respected.</p>', 'Director Desk', '', 'publish', 'closed', 'closed', '', 'director-desk', '', '', '2016-01-24 14:04:53', '2016-01-24 14:04:53', '', 41, 'http://ebenezerssschool.org/?page_id=215', 0, 'page', '', 0),
