(222, 1, '2016-01-11 08:03:11', '2016-01-11 08:03:11', '<img class="alignnone wp-image-422" src="http://www.ebenezerssschool.org/wp-content/uploads/2016/01/DSC05080.jpg" alt="dsc05080" width="338" height="253" />\r\n\r\n<strong>School  An extensional of the family.</strong>\r\n\r\n<strong>There was a time when family trained and bought an essential including professionals and vocational training. </strong>\r\n\r\n<strong> With passage of Time, the different part of the globe got closer knowledge now become and is becoming more and more too exhaustive to be managed by family or certain people. Then come the need to send children to Patselas and now to well equipped public school. </strong>\r\n\r\n<strong> So parent and school are complementary component because both work and aim at same mission all round multifarious development of the child to prepare him/her an efficient professional as well as a responsible citizen.</strong>', 'Administrative Officer', '', 'publish', 'closed', 'closed', '', 'administrative-officer', '', '', '2017-01-04 17:03:15', '2017-01-04 11:33:15', '', 41, 'http://ebenezerssschool.org/?page_id=222', 0, 'page', '', 0),
