(225, 1, '2016-01-11 08:07:44', '2016-01-11 08:07:44', '<img class="alignnone  wp-image-237" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/DSC05084-compressed-1024x768.jpg" alt="DSC05084-compressed" width="396" height="297" />\r\n\r\nA school is always a world in miniature where one receives a  training for life: Our philosophy ofeducation has always been meeting the needs of the individual child. Children acquire skills andknowledge easily if we can make the surrounding stimulating and purposeful.\r\n\r\nThe aim of our school is to develop a good sense of discipline and moral values within the ever changingsocial norms of society. Our co-curricular and extra curricular activities are very well balanced tocomplement and supplement our curriculum.\r\n\r\nMam.Rajani Yadav', 'Head Mistress', '', 'publish', 'closed', 'closed', '', 'head-mistress', '', '', '2016-01-24 13:46:05', '2016-01-24 13:46:05', '', 41, 'http://ebenezerssschool.org/?page_id=225', 0, 'page', '', 0),
