(244, 1, '2016-01-24 13:47:54', '2016-01-24 13:47:54', '<p style="text-align: justify;"><img class="alignnone size-large wp-image-243" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/DSC05078-compressed-1024x768.jpg" alt="DSC05078-compressed" width="1024" height="768" />A school Is always a world in miniature , where one receives a training of life , where effective , meaningful and joyful learning take place , it is here that we begin to learn our lesson of life  to accept challenges, face competitions, defeat and failure, and rejoice at victory and triumph. Our school is scaling new height with excellent and reputed national and international level coaches who are children in a range of co-curricular activities like throw-ball, baseball, soft-tennis etc. For the future, we are hopeful that we will be able to fulfill all the expectation of our student and their parents for best education as well as the personality development so that they can go in outer world with the strength to excel in their professional life by being a beautiful human and responsible citizen of our country.</p>', 'From the Principal ''s Desk', '', 'inherit', 'closed', 'closed', '', '47-autosave-v1', '', '', '2016-01-24 13:47:54', '2016-01-24 13:47:54', '', 47, 'http://ebenezerssschool.org/2016/01/24/47-autosave-v1/', 0, 'revision', '', 0),
(245, 1, '2016-01-24 13:48:15', '2016-01-24 13:48:15', '<p style="text-align: justify;"><img class="alignnone  wp-image-243" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/DSC05078-compressed-1024x768.jpg" alt="DSC05078-compressed" width="423" height="317" /></p>\r\n<p style="text-align: justify;">A school Is always a world in miniature , where one receives a training of life , where effective , meaningful and joyful learning take place , it is here that we begin to learn our lesson of life  to accept challenges, face competitions, defeat and failure, and rejoice at victory and triumph. Our school is scaling new height with excellent and reputed national and international level coaches who are children in a range of co-curricular activities like throw-ball, baseball, soft-tennis etc. For the future, we are hopeful that we will be able to fulfill all the expectation of our student and their parents for best education as well as the personality development so that they can go in outer world with the strength to excel in their professional life by being a beautiful human and responsible citizen of our country.</p>', 'From the Principal ''s Desk', '', 'inherit', 'closed', 'closed', '', '47-revision-v1', '', '', '2016-01-24 13:48:15', '2016-01-24 13:48:15', '', 47, 'http://ebenezerssschool.org/2016/01/24/47-revision-v1/', 0, 'revision', '', 0),
(246, 1, '2016-01-24 13:50:42', '2016-01-24 13:50:42', '<p style="text-align: justify;"><img class="alignnone  wp-image-208" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/55-1024x683.jpg" alt="55" width="405" height="270" /></p>\r\n<p style="text-align: justify;">The school own transport of its own playing between different areas and the school complete to transport the students from home to school and back.</p>', 'Transport', '', 'inherit', 'closed', 'closed', '', '102-revision-v1', '', '', '2016-01-24 13:50:42', '2016-01-24 13:50:42', '', 102, 'http://ebenezerssschool.org/2016/01/24/102-revision-v1/', 0, 'revision', '', 0),
(247, 1, '2016-01-24 13:53:04', '2016-01-24 13:53:04', '<p style="text-align: justify;"><img class="alignnone  wp-image-204" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/DSC_5487-1024x683.jpg" alt="DSC_5487" width="378" height="252" /></p>\r\n<p style="text-align: justify;">The Library makes available a wide selection of reading material . It promotes reading habits among students works as an agency for their life long continuous self education . It motivates and encourages the habit of reading which will help knowledge . A wide range of fictional and factual works transport the minds of our students to a land of fantacy and make believe, when in mind of recreation. We have a well equipped open-self library.</p>', 'Library', '', 'inherit', 'closed', 'closed', '', '100-revision-v1', '', '', '2016-01-24 13:53:04', '2016-01-24 13:53:04', '', 100, 'http://ebenezerssschool.org/2016/01/24/100-revision-v1/', 0, 'revision', '', 0),
(248, 1, '2016-01-24 14:04:53', '2016-01-24 14:04:53', '<p style="text-align: justify;">The goal before us is to create an atmosphere which will turn the thoughts and aspirations of our children towards the liberation of spirit. Our school is firstly responsible for maintaining a caring environment and continuously work on an exemplary and successful teaching-learning, extra curricular and co-curricular practices with a decision making personality, which provides an extra-ordinary identity for each child. Our staff continues to move forward through thoughtful planning,maintenance of effective curriculum creation of new programs and powerful partnerships with both parents and society members .Our effective Parents-Teachers meeting continued to work diligently to create a supportive and caring school community. Lets continue our partnership in helping each other to make Ebenezer a wonderful place for our children . Let us create an atmosphere where students feel safe comfortable and respected.</p>', 'Director Desk', '', 'inherit', 'closed', 'closed', '', '215-revision-v1', '', '', '2016-01-24 14:04:53', '2016-01-24 14:04:53', '', 215, 'http://ebenezerssschool.org/2016/01/24/215-revision-v1/', 0, 'revision', '', 0),
(249, 1, '2016-01-25 10:45:25', '2016-01-25 10:45:25', '&nbsp;\r\n<table id="institutionDetails" class="table table no-margin">\r\n<tbody>\r\n<tr class="user-fb-row">\r\n<th>Address</th>\r\n<td>1, Upadhyay Nagar, Mendhaki Road, Dewas (M.P)</td>\r\n</tr>\r\n<tr class="user-fb-row">\r\n<th>Affiliation</th>\r\n<td><a href="http://www.prokerala.com/education/cbse-schools-in-dewas.html">CBSE</a></td>\r\n</tr>\r\n<tr class="user-fb-row">\r\n<th>Established</th>\r\n<td>1988</td>\r\n</tr>\r\n<tr>\r\n<th>Phone</th>\r\n<td>07272-229984, 228884,405494</td>\r\n</tr>\r\n<tr class="user-fb-row">\r\n<th>E-mail</th>\r\n<td>school.ebenezer@gmail.com</td>\r\n</tr>\r\n<tr class="user-fb-row">\r\n<th>Management</th>\r\n<td>Ebenezer Society</td>\r\n</tr>\r\n<tr class="user-fb-row">\r\n<th>Education Category</th>\r\n<td>Co-educational</td>\r\n</tr>\r\n<tr class="user-fb-row">\r\n<th>Location</th>\r\n<td>Dewas, Madhya Pradesh - 455001</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n[contact-form-7 id="171" title="Contact form 1"]\r\n\r\n&nbsp;', 'Contact Us', '', 'inherit', 'closed', 'closed', '', '52-revision-v1', '', '', '2016-01-25 10:45:25', '2016-01-25 10:45:25', '', 52, 'http://ebenezerssschool.org/2016/01/25/52-revision-v1/', 0, 'revision', '', 0),
(250, 1, '2016-01-25 11:03:35', '2016-01-25 11:03:35', '', '12584166_916424965106904_1869758518_n', '', 'inherit', 'open', 'closed', '', '12584166_916424965106904_1869758518_n', '', '', '2016-01-25 11:03:35', '2016-01-25 11:03:35', '', 0, 'http://ebenezerssschool.org/wp-content/uploads/2016/01/12584166_916424965106904_1869758518_n.jpg', 0, 'attachment', 'image/jpeg', 0),
(251, 1, '2016-01-27 09:28:57', '2016-01-27 09:28:57', '<p style="text-align: justify;"><img class="wp-image-198 alignright" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/33-1024x683.jpg" alt="33" width="560" height="373" /></p>\r\n<p style="text-align: justify;"></p>\r\n<p style="text-align: justify;"></p>\r\n<p style="text-align: justify;"></p>\r\n<p style="text-align: justify;"></p>\r\n<p style="text-align: justify;"></p>\r\n<p style="text-align: justify;"></p>\r\n<p style="text-align: justify;"></p>\r\n<p style="text-align: justify;">Our Science lab is fully equipped with the latest apparatus to bring forth the scientist in every child .The basic purpose of the lab is to prepare children for life by instilling in them an approach to analyse problems and find solutions on their own.\r\nHistory comes alive in our Social Science lab and make the students aware of their wonderful natural heritage and their responsibility helps our children imbibe majestic traditions with modern thoughts and attitudes.\r\nThey learn the skills to solve mathematics by fun and by using tools.</p>', 'Labs', '', 'inherit', 'closed', 'closed', '', '98-revision-v1', '', '', '2016-01-27 09:28:57', '2016-01-27 09:28:57', '', 98, 'http://www.ebenezerssschool.org/2016/01/27/98-revision-v1/', 0, 'revision', '', 0),
(252, 1, '2016-01-27 09:31:11', '2016-01-27 09:31:11', '<p style="text-align: justify;"><img class="wp-image-198 aligncenter" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/33-1024x683.jpg" alt="33" width="560" height="373" /></p>\r\n<p style="text-align: justify;">Our Science lab is fully equipped with the latest apparatus to bring forth the scientist in every child .The basic purpose of the lab is to prepare children for life by instilling in them an approach to analyse problems and find solutions on their own.\r\nHistory comes alive in our Social Science lab and make the students aware of their wonderful natural heritage and their responsibility helps our children imbibe majestic traditions with modern thoughts and attitudes.\r\nThey learn the skills to solve mathematics by fun and by using tools.</p>', 'Labs', '', 'inherit', 'closed', 'closed', '', '98-revision-v1', '', '', '2016-01-27 09:31:11', '2016-01-27 09:31:11', '', 98, 'http://www.ebenezerssschool.org/2016/01/27/98-revision-v1/', 0, 'revision', '', 0),
(253, 1, '2016-01-27 10:01:37', '2016-01-27 10:01:37', '<h1 align="center"></h1>\r\n<table cellspacing="5">\r\n<tbody>\r\n<tr>\r\n<th style="text-align: left;">Name</th>\r\n<th style="text-align: left;">Designation</th>\r\n</tr>\r\n<tr>\r\n<td style="text-align: left;" width="40%">MR. ASHOK JOSHI</td>\r\n<td style="text-align: left;">DIRECTOR</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: left;" width="40%">MRS. ARCHALA SHRIWASTAV</td>\r\n<td style="text-align: left;">PRINCIPAL</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: left;">MR. L.N. SHRIWASTAV</td>\r\n<td style="text-align: left;">ADMINISTRATIVE OFFICER</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: left;" width="40%">MRS. RAJANI YADAV</td>\r\n<td style="text-align: left;">HEAD MISTRESS</td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: left;" width="40%"></td>\r\n<td style="text-align: left;"></td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: left;" width="40%"></td>\r\n<td style="text-align: left;"></td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: left;">MRS.ROSY MATHEW</td>\r\n<td style="text-align: left;"></td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: left;" width="30%"></td>\r\n<td style="text-align: left;"></td>\r\n</tr>\r\n<tr>\r\n<td style="text-align: left;" width="30%"></td>\r\n<td style="text-align: left;"></td>\r\n</tr>\r\n</tbody>\r\n</table>', 'MANAGING COMMITTEE', '', 'inherit', 'closed', 'closed', '', '91-revision-v1', '', '', '2016-01-27 10:01:37', '2016-01-27 10:01:37', '', 91, 'http://www.ebenezerssschool.org/2016/01/27/91-revision-v1/', 0, 'revision', '', 0),
(254, 1, '2016-01-27 10:09:41', '2016-01-27 10:09:41', '<strong>ADMISSION</strong>\r\n<ul>\r\n	<li>Open to all boys and girls irrespective of caste,creed or race.</li>\r\n	<li>pupils must complete three years of age for Nursery,four years of age on 1st July for being eligible for adimission to KG I. Corresponding scales of age will be fixed for the succeeding classes.</li>\r\n	<li>The following documents are required at the time of admission.</li>\r\n	<li>BirthCertificate for Nursery,KG and UKG.</li>\r\n	<li>TC Duly Counter Signed</li>\r\n	<li>Photocopy of the Report Card</li>\r\n	<li>First Fee instalment</li>\r\n	<li>Copy of Caste Certificate for SC/ST/OBC</li>\r\n	<li>Migration Certificate (if previous exam passed from different Board)</li>\r\n</ul>\r\n<strong>EXAMINATIONS</strong>\r\n<ul>\r\n	<li>As per CBSE norms,Formative and Summative Assessments shall be conducted .</li>\r\n	<li>In case of medical leave during examination , a medical certificate should be furnished.</li>\r\n	<li>Students absent from test/examination without adequate reasons or prior permission will be considered as having failed. Students absent from examination will not be re-examined.</li>\r\n	<li>Students using unfair means at examination will be dealt with severely and may be expelled from the school.</li>\r\n</ul>', 'Guidelines', '', 'inherit', 'closed', 'closed', '', '108-revision-v1', '', '', '2016-01-27 10:09:41', '2016-01-27 10:09:41', '', 108, 'http://www.ebenezerssschool.org/2016/01/27/108-revision-v1/', 0, 'revision', '', 0),
(255, 1, '2016-01-27 11:09:25', '2016-01-27 11:09:25', '<p style="text-align: justify;"><img class="alignnone wp-image-208" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/55-1024x683.jpg" alt="55" width="405" height="270" /></p>\r\nSchool has at its own transort facility, Our school provides a good conveyance facilitiy to our students from all corners of Dewas.', 'Transport', '', 'inherit', 'closed', 'closed', '', '102-revision-v1', '', '', '2016-01-27 11:09:25', '2016-01-27 11:09:25', '', 102, 'http://www.ebenezerssschool.org/2016/01/27/102-revision-v1/', 0, 'revision', '', 0);
