(261, 1, '2016-01-28 18:09:12', '2016-01-28 18:09:12', '<p style="text-align: justify;"><img class="wp-image-204 aligncenter" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/DSC_5487-1024x683.jpg" alt="DSC_5487" width="378" height="252" /></p>\r\n<p style="text-align: justify;">The Library makes available a wide selection of reading material . It promotes reading habits among students works as an agency for their life long continuous self education . It motivates and encourages the habit of reading which will help knowledge . A wide range of fictional and factual works transport the minds of our students to a land of fantacy and make believe, when in mind of recreation. We have a well equipped open-self library.</p>', 'Library', '', 'inherit', 'closed', 'closed', '', '100-revision-v1', '', '', '2016-01-28 18:09:12', '2016-01-28 18:09:12', '', 100, 'http://www.ebenezerssschool.org/2016/01/28/100-revision-v1/', 0, 'revision', '', 0),
