(414, 1, '2016-12-30 23:26:41', '2016-12-30 17:56:41', '<img class="size-full wp-image-186 aligncenter" src="http://ebenezerssschool.org/wp-content/uploads/2016/01/about-us_pages_banner-compressed.jpg" alt="about-us_pages_banner-compressed" width="965" height="329" />\r\n<p style="text-align: justify;">Ebenezer Higher Secondary School located in Upadhyay Nagar, Mendhaki Road, is a Co-Educational Senior Secondary institution affiliated to the Central Board of Secondary Education (CBSE) on Provisional basis since 1988. The school has been operating officially under the trust/society Ebenezer Society. The school is equipped with 28 class rooms and all essential facilities. If you''re looking for details in admission/application forms, fees, school timings, vacations/holidays schedule or facilities provided, kindly visit the relevant department of the school.</p>', 'About', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2016-12-30 23:26:41', '2016-12-30 17:56:41', '', 41, 'http://www.ebenezerssschool.org/2016/12/30/41-revision-v1/', 0, 'revision', '', 0),
